import React from "react";
import styled, { keyframes } from "styled-components";
import {
  BGContentShopTeam,
  DiamondContainerBottom,
  DiamondContainerLeft,
  DiamondContainerTop,
  LOGOBGContainer,
  ShopTeamContentContainer,
} from "./style";

const LogoContainer = styled.div`
  width: 125px;
  height: 100%;
  position: relative;
  &:hover ${DiamondContainerTop} {
    top: 30px;
    transition: top 2s;
  }
  &:hover ${DiamondContainerLeft} {
    left: 30px;
    transition: left 2s;
  }
  &:hover ${DiamondContainerBottom} {
    display: none;
  }
`;

function Index() {
  return (
    <>
      <LogoContainer>
        <LOGOBGContainer>
          <DiamondContainerTop />
          <DiamondContainerLeft />
          <DiamondContainerBottom />
        </LOGOBGContainer>
        <BGContentShopTeam>
          <ShopTeamContentContainer>SHOP TEAM</ShopTeamContentContainer>
        </BGContentShopTeam>
      </LogoContainer>
    </>
  );
}

export default Index;
